                this.highScoreText.x = this.stage.canvas.width /this.stage.scaleX / 2 - this.highScoreText.getBounds().width / 2;
                this.highScoreText.y = this.newGameText.y + this.newGameText.getBounds().height + TEXT_VERTICAL_MARGIN;
